import React from 'react';
import { StyleSheet, View, Text} from 'react-native';

const FaceNameCard = () => {

    return(
        <View style={styles.container}>
            <View>
                <Text
                    style={{
                        color:'#C2DFF4',
                        fontSize:16,
                    }}
                >
                    This is a registered card
                </Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        width: '95%',
        backgroundColor: '#2d6187',
        // alignItems:'center',
        justifyContent:'center',
        padding:10,
        height:55,
        borderRadius:8,
        borderColor:'#9bb2c2',
        borderWidth:1,
        borderStyle: 'dotted',
    },
})

export default FaceNameCard;
